export interface DeepFreezeOptions<T> {
    previousValue?: T;
    equalityCheck?(valueA: any, valueB: any): boolean;
}
export default function deepFreeze<T>(object: T[], options?: DeepFreezeOptions<T>): ReadonlyArray<T>;
